import './Explor.css';
import React from 'react'
import Dif from './explore-dif/Dif';
import ExploreImages from './ExploreImage/ExploreImages';
import Discove from './Discover/Discove';

const Explorepage = () => {
  return (
    <div className='explore'>
      <Dif/>
      <ExploreImages/>
      <Discove/>
    </div>
  )
}

export default Explorepage;
